import React from 'react'

import {Link} from "react-router-dom";

export const Navbar = () => {
  return (
    <nav>
        <ul>
            <Link> Practice  </Link>
            <Link> Problem List </Link>
        </ul>
    </nav>
  )
}

export default Navbar
